Moin Moin,
ich habe nach einem Jahr Pause wieder angefangen zu spielen und suche zum gemeinsamen Ranken einen DuoQ Mate, idealerweise im Jungle oder zusammen mit mir auf der Botlane. Meine h&ouml;chste Division war Diamond V , besonders lange war ich da allerdings nicht, nicht zuletzt auch dem Zeitmangel geschuldet der mich zur Pause gezwungen hat.
H&auml;ufig gespielte Champs: {{champion:15}} {{champion:119}} {{champion:67}} {{champion:29}} 

Ich suche f&uuml;r den Goldbereich, da ich f&uuml;r Platin und h&ouml;heres erst wieder vollst&auml;ndig ins Spiel reinfinden muss, was aber bis Seasonanfang kein Problem sein sollte.
Wirklich besondere Anforderungen habe ich eigentlich nicht, wichtig ist mir im Grunde nur, dass man sich gut versteht und die Synergie da ist.

